        {
            id:0,
            title: "Graphic Design",
            projectTypes: [
                "Visual brand identity",
                "UI Design",
                "Print & Layout design",
                "Illustration"
            ],
        },
        {
            id:1,
            title: "Motion Design",
            projectTypes: [
                "Logo Animation",
                "Explainer video",
                "Character animation"
            ],
        },
    ]
    const specialtiesList = specialties.map(specialty => {
        return(
            <Specialty 
                key={specialty.id}
                title={specialty.title}
                typesLists={specialty.projectTypes}
            />
        )
    })
    return (
        <main className='elegant'>
